const MenuList=()=>{
  //전체 카테고리와 메뉴를 불러오기
  const allMenu=async()=>await axios.post('http://127.0.0.1:8000/webKiosk/client/meca/download/',
  {
    "market_name" : "S"
  });
  console.log(allMenu());
  return(
  <div className="tableContainer">
  <table className="table">
    <thead>
      <tr id="tre">
        <th className="col">#</th>
        <th className="col">이름</th>
        <th className="col">수량</th>
        <th className="col">판매상태</th>
        <th className="col">###</th>
      </tr>
    </thead>
    <tbody>
      {Object.keys(allMenu).map((item)=>{
          console.log(item)
        return(
          
        <tr>
          <td>{JSON.stringify(item)}</td>
          <td><button>주문</button></td>
        </tr>
        )
      }
      )
    }
    </tbody>
  </table>
  </div>
      )
  };

export default MenuList;
